import Kaede from './Kaede';
import Hoshi from './Hoshi';
import Jiro from './Jiro';
import Isao from './Isao';
import Madoka from './Madoka';
import Akira from './Akira';
import Hideo from './Hideo';
import Kohana from './Kohana';
import Makiko from './Makiko';
import Sae from './Sae';
import Fumi from './Fumi';

export {
  Kaede,
  Hoshi,
  Jiro,
  Isao,
  Madoka,
  Akira,
  Hideo,
  Kohana,
  Makiko,
  Sae,
  Fumi,
};
